import "./App.css";

function App() {
  const [sidebaropen , setSidebarOpen] = useState(false)

  const handleSideBarOpen = ()=>{
    setSidebarOpen(true);
  }
  const handleSideBarClosed = ()=>{
    setSidebarOpen(false);
  }
  return (

    <div className="App">
      <header className="App-header"></header>
    </div>
  );
}

export default App;
